import React from 'react'
import USChart from '../Charts/UnitedStatesCases'
import IndiaChart from '../Charts/IndiaCases'

function Home() {

    if(2+2==4)
        return (
            <div>
                <USChart />
            </div>
        );

    if(1+1==2)
        return (
            <div>
                <IndiaChart />
            </div>
        );
}

export default Home;
